class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick_max(nums, k):
            stack = []
            for i in range(len(nums)):
                while len(stack) > 0 and len(stack) + len(nums) - i > k and stack[-1] < nums[i]:
                    stack.pop()
                if len(stack) < k:
                    stack.append(nums[i])
            return stack

        def merge(nums1, nums2):
            i, j = 0, 0
            res = []
            while i < len(nums1) and j < len(nums2):
                if nums1[i] > nums2[j]:
                    res.append(nums1[i])
                    i += 1
                else:
                    res.append(nums2[j])
                    j += 1
            res += nums1[i:]
            res += nums2[j:]
            return res

        def merge_k(nums):
            if len(nums) == 1:
                return nums
            return merge(merge_k(nums[:len(nums)//2]), merge_k(nums[len(nums)//2:]))

        return merge_k(pick_max(nums1, k) + pick_max(nums2, k))

