class Solution(object):
    def firstUniqChar(self, s):
        """
        :type s: str
        :rtype: int
        """

        ## Time Complexity: O(n)
        ## Space Complexity: O(1)

        ## Approach:
        ## 1. Create a hashmap with key as the character and value as the index of the character
        ## 2. Iterate through the string and check if the character is already in the hashmap
        ## 3. If the character is already in the hashmap, then update the value of the character to -1
        ## 4. If the character is not in the hashmap, then add the character to the hashmap with value as the index of the character
        ## 5. Iterate through the string again and return the value of the character if the value is not -1
        ## 6. If the character is not in the hashmap, then return -1

        hashmap = {}
        for i in range(len(s)):
            if s[i] in hashmap:
                hashmap[s[i]] = -1
            else:
                hashmap[s[i]] = i

        for i in range(len(s)):
            if hashmap[s[i]] != -1:
                return hashmap[s[i]]

        return -1

