        :rtype: int
        """

        if root is None:
            return 0

        left_height = self.get_height(root.left)
        right_height = self.get_height(root.right)

        if left_height == right_height:
            return (2**left_height) + self.countNodes(root.right)
        else:
            return (2**right_height) + self.countNodes(root.left)

