            return s

        left = 0
        right = 0
        min_len = len(s) + 1
        min_left = 0
        min_right = 0
        while right < len(s):
            if s[right] in t_dict:
                if s_dict[s[right]] > t_dict[s[right]]:
                    s_dict[s[right]] -= 1
                else:
                    s_dict[s[right]] -= 1
                    left += 1
            right += 1

        while left < len(s):
            if s[left] in t_dict:
                if s_dict[s[left]] < t_dict[s[left]]:
                    s_dict[s[left]] += 1
                else:
                    s_dict[s[left]] += 1
                    left += 1
            left += 1

