    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        ## Solution 1:
        ## Time Complexity: O(n)
        ## Space Complexity: O(1)

        ## Approach:
        ## 1. Create a hashmap to store the frequency of each character in s
        ## 2. Iterate through t and decrement the frequency of each character in the hashmap
        ## 3. Return the character with a frequency of 1

        ## Code:
        hashmap = {}
        for char in s:
            if char not in hashmap:
                hashmap[char] = 1
            else:
                hashmap[char] += 1

        for char in t:
            if char not in hashmap:
                return char
            else:
                hashmap[char] -= 1

        for key, value in hashmap.items():
            if value == 1:
                return key

        return ""

